import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand" href="/"
        style={{ textAlign: "center" }}
      >
        HouseWork
      </a>
      <a className="" href="#modal-log-in" id="logInBtn" uk-toggle style={{float: right}}>Log In</a>
      <a className="" href="#modal-sign-up" id="signUpBtn" uk-toggle style={{float: right}}>Sign Up</a>
    </nav>
  );
}

export default Nav;
